def max_and_index(num_str: str):
    """
    0-based
    
        >>> max_and_index("-0.392578 4.40625 2.29688")
        (4.40625, 1)
    """
    nums = list(map(float, num_str.strip().split()))
    max_idx = max(range(len(nums)), key=nums.__getitem__)
    return nums[max_idx], max_idx

